try/except를 사용하여 예외를 처리하십시오. 주요 저자 솔루션: 파이썬 2 def throws(): return 5/0 try: throws()
except ZeroDivisionError: # 0으로 나누려고 할 때 발생하는 예외 print "0으로 나누었습니다!"
except Exception, err: # 다른 모든 예외 처리 (Python 2 구문) print '예외가 발생했습니다'
finally: # 예외 발생 여부와 관계없이 항상 실행 print '정리를 위한 finally 블록입니다' 내 솔루션: 파이썬 3 def divide(): return 5/0 try: divide()
except ZeroDivisionError as ze: # ZeroDivisionError 예외를 잡아 변수 ze에 할당 print("왜 숫자를 0으로 나누려고 하십니까!!")
except: # 다른 모든 예외 처리 print("기타 예외")

