입력 순서를 얻기 위해 리스트를 만들고 단어 빈도를 계산하기 위해 사전을 만드십시오. 내 솔루션: 파이썬 3 n = int(input()) # 입력될 단어의 총 개수 word_list = [] # 입력된 단어의 순서를 유지하기 위한 리스트
word_dict = {} # 각 단어의 빈도수를 저장하기 위한 딕셔너리 for i in range(n): word = input() if word not in word_dict: # 단어가 딕셔너리에 처음 등장하면 word_list.append(word) # 순서 리스트에 추가 word_dict[word] = word_dict.get(word, 0) + 1 # 해당 단어의 빈도수 증가 print(len(word_list)) # 고유한 단어의 개수 출력
for word in word_list: # 입력된 순서대로 각 단어에 대해 print(word_dict[word], end=' ') # 해당 단어의 빈도수 출력 (공백으로 구분)
